defined('_JEXEC') or die;

class JFormFieldSjThumbnailMode extends JFormFieldList {
	protected $type = 'sjthumbnailmode';
	var $_mode = array('none', 'center', 'fill', 'fit', 'stretch');
	
	function getInput(){
		return parent::getInput();
	}
	public function getLabel(){
		$this->description = $this->_image_thumbnail_mode();
		return parent::getLabel();
	}

	private function _image_thumbnail_mode(){
		return "<img style=\"height: 60px;\" src=\"data:;base64,\" />";
	}
}
